description:
This activity proposes to sustain this newly created policy-hub in 2014-2015. GYM represents an excellent opportunity to strengthen and expand the work undertaken by UNESCO since 2011 with the Internal Migration in India Initiative (IMII), and continue contributing in an active manner in favour of the inclusion of migrants in the life of society at social, cultural, political, and economical level.

The activity will also seek to strengthen the capacity of community radio to broadcast migrant sensitive programmes; 

